import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'networkidle' });

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Step 1: Add an item to the cart programmatically to set up the test state
    // This is a robust way to prepare for the removal test
    await page.evaluate(() => {
      // @ts-ignore
      addToCart(1); // Assuming addToCart function is globally available from the script
    });

    // Wait for the cart counter to update
    await page.waitForFunction(() => {
      const cartCount = document.getElementById('cartCount');
      return cartCount && cartCount.textContent?.trim() === '1';
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // Step 2: Click on the cart to open the cart modal
    const cartIcon = page.locator('div.cart');
    await cartIcon.click();

    // Step 3: Wait for the cart modal to be visible
    const cartModal = page.locator('#cartModal');
    await cartModal.waitFor({ state: 'visible' });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_visible.png'));

    // Step 4: Locate and click the "Remove" button within the cart item
    const removeItemButton = cartModal.locator('button.remove-item');
    await removeItemButton.waitFor({ state: 'visible' });
    await removeItemButton.click();

    // Step 5: Verify the item is removed by checking for the "empty cart" message
    const emptyCartMessage = cartModal.locator('.empty-cart');
    await emptyCartMessage.waitFor({ state: 'visible' });

    const extractedText = await emptyCartMessage.textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        confirmationMessage: extractedText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
